class GISCoordinateConverter:
    def __init__(self):
        # 坐标转换参数
        self.pi = 3.1415926535897932384626
        self.a = 6378245.0
        self.ee = 0.00669342162296594323

    def gcj02_to_wgs84(self, lng, lat):
        """GCJ-02转WGS84"""
        if self.out_of_china(lng, lat):
            return lng, lat
        dlat = self.transform_lat(lng - 105.0, lat - 35.0)
        dlng = self.transform_lng(lng - 105.0, lat - 35.0)
        radlat = lat / 180.0 * self.pi
        magic = math.sin(radlat)
        magic = 1 - self.ee * magic * magic
        sqrtmagic = math.sqrt(magic)
        dlat = (dlat * 180.0) / ((self.a * (1 - self.ee)) / (magic * sqrtmagic) * self.pi)
        dlng = (dlng * 180.0) / (self.a / sqrtmagic * math.cos(radlat) * self.pi)
        mglat = lat + dlat
        mglng = lng + dlng
        return lng * 2 - mglng, lat * 2 - mglat

    def wgs84_to_gcj02(self, lng, lat):
        """WGS84转GCJ-02"""
        if self.out_of_china(lng, lat):
            return lng, lat
        dlat = self.transform_lat(lng - 105.0, lat - 35.0)
        dlng = self.transform_lng(lng - 105.0, lat - 35.0)
        radlat = lat / 180.0 * self.pi
        magic = math.sin(radlat)
        magic = 1 - self.ee * magic * magic
        sqrtmagic = math.sqrt(magic)
        dlat = (dlat * 180.0) / ((self.a * (1 - self.ee)) / (magic * sqrtmagic) * self.pi)
        dlng = (dlng * 180.0) / (self.a / sqrtmagic * math.cos(radlat) * self.pi)
        return lng + dlng, lat + dlat

    def bd09_to_gcj02(self, bd_lon, bd_lat):
        """BD-09转GCJ-02"""
        x = bd_lon - 0.0065
        y = bd_lat - 0.006
        z = math.sqrt(x * x + y * y) - 0.00002 * math.sin(y * self.pi)
        theta = math.atan2(y, x) - 0.000003 * math.cos(x * self.pi)
        gcj_lon = z * math.cos(theta)
        gcj_lat = z * math.sin(theta)
        return gcj_lon, gcj_lat

    def gcj02_to_bd09(self, lng, lat):
        """GCJ-02转BD-09"""
        z = math.sqrt(lng * lng + lat * lat) + 0.00002 * math.sin(lat * self.pi)
        theta = math.atan2(lat, lng) + 0.000003 * math.cos(lng * self.pi)
        bd_lon = z * math.cos(theta) + 0.0065
        bd_lat = z * math.sin(theta) + 0.006
        return bd_lon, bd_lat

    def wgs84_to_bd09(self, lng, lat):
        """WGS84转BD-09"""
        gcj_lng, gcj_lat = self.wgs84_to_gcj02(lng, lat)
        return self.gcj02_to_bd09(gcj_lng, gcj_lat)

    def bd09_to_wgs84(self, lng, lat):
        """BD-09转WGS84"""
        gcj_lng, gcj_lat = self.bd09_to_gcj02(lng, lat)
        return self.gcj02_to_wgs84(gcj_lng, gcj_lat)

    def transform_lat(self, lng, lat):
        ret = -100.0 + 2.0 * lng + 3.0 * lat + 0.2 * lat * lat + 0.1 * lng * lat + 0.2 * math.sqrt(abs(lng))
        ret += (20.0 * math.sin(6.0 * lng * self.pi) + 20.0 * math.sin(2.0 * lng * self.pi)) * 2.0 / 3.0
        ret += (20.0 * math.sin(lat * self.pi) + 40.0 * math.sin(lat / 3.0 * self.pi)) * 2.0 / 3.0
        ret += (160.0 * math.sin(lat / 12.0 * self.pi) + 320 * math.sin(lat * self.pi / 30.0)) * 2.0 / 3.0
        return ret

    def transform_lng(self, lng, lat):
        ret = 300.0 + lng + 2.0 * lat + 0.1 * lng * lng + 0.1 * lng * lat + 0.1 * math.sqrt(abs(lng))
        ret += (20.0 * math.sin(6.0 * lng * self.pi) + 20.0 * math.sin(2.0 * lng * self.pi)) * 2.0 / 3.0
        ret += (20.0 * math.sin(lng * self.pi) + 40.0 * math.sin(lng / 3.0 * self.pi)) * 2.0 / 3.0
        ret += (150.0 * math.sin(lng / 12.0 * self.pi) + 300.0 * math.sin(lng / 30.0 * self.pi)) * 2.0 / 3.0
        return ret

    def out_of_china(self, lng, lat):
        """判断是否在中国境内"""
        if lng < 72.004 or lng > 137.8347:
            return True
        if lat < 0.8293 or lat > 55.8271:
            return True
        return False

    def convert_coordinates(self, coords, from_crs, to_crs):
        """坐标转换主函数"""
        converted = []
        conversion_func = None

        # 确定转换函数
        if from_crs == "GCJ-02" and to_crs == "WGS84":
            conversion_func = self.gcj02_to_wgs84
        elif from_crs == "WGS84" and to_crs == "GCJ-02":
            conversion_func = self.wgs84_to_gcj02
        elif from_crs == "BD-09" and to_crs == "WGS84":
            conversion_func = self.bd09_to_wgs84
        elif from_crs == "WGS84" and to_crs == "BD-09":
            conversion_func = self.wgs84_to_bd09
        elif from_crs == "GCJ-02" and to_crs == "BD-09":
            conversion_func = self.gcj02_to_bd09
        elif from_crs == "BD-09" and to_crs == "GCJ-02":
            conversion_func = self.bd09_to_gcj02
        elif from_crs == "CGCS2000" and to_crs == "WGS84":
            # CGCS2000与WGS84差异很小，这里直接返回
            return coords
        elif from_crs == "WGS84" and to_crs == "CGCS2000":
            return coords
        elif from_crs == to_crs:
            return coords
        else:
            # 处理其他可能的转换组合
            if "GCJ-02" in from_crs:
                if "WGS84" in to_crs:
                    conversion_func = self.gcj02_to_wgs84
                elif "BD-09" in to_crs:
                    conversion_func = self.gcj02_to_bd09
            elif "BD-09" in from_crs:
                if "WGS84" in to_crs:
                    conversion_func = self.bd09_to_wgs84
                elif "GCJ-02" in to_crs:
                    conversion_func = self.bd09_to_gcj02

        if conversion_func:
            for coord in coords:
                if len(coord) >= 2:
                    lon, lat = conversion_func(coord[0], coord[1])
                    if len(coord) > 2:
                        converted.append([lon, lat] + coord[2:])
                    else:
                        converted.append([lon, lat])
        else:
            # 如果没有找到转换函数，返回原坐标
            converted = coords

        return converted


