    def set_window_icon(self):
        """设置窗口图标，优先使用base64，其次使用外部文件"""
        try:
            # 方法1：从base64字符串设置图标
            if 'logo_ico' in globals() and logo_ico:
                try:
                    import tempfile
                    import base64

                    # 解码base64数据
                    # 注意：base64字符串可能被截断了，需要确保是完整的
                    # 先清理base64字符串（移除空格和换行）
                    cleaned_base64 = logo_ico.strip().replace('\n', '').replace(' ', '')

                    # 解码base64
                    try:
                        icon_data = base64.b64decode(cleaned_base64)

                        # 创建临时文件
                        with tempfile.NamedTemporaryFile(delete=False, suffix='.ico') as tmp_file:
                            tmp_file.write(icon_data)
                            temp_icon_path = tmp_file.name

                        # 设置窗口图标
                        self.root.iconbitmap(temp_icon_path)

                        # 保存临时文件路径，以便程序退出时清理
                        self.temp_icon_path = temp_icon_path

                        print("成功从base64设置窗口图标")

                    except Exception as decode_error:
                        print(f"base64解码失败: {decode_error}")
                        # 尝试从外部文件设置图标
                        self.try_external_icon()

                except Exception as e:
                    print(f"从base64设置图标失败: {e}")
                    self.try_external_icon()

            else:
                # 如果base64变量不存在，尝试从外部文件设置
                self.try_external_icon()

        except Exception as e:
            print(f"设置窗口图标失败: {e}")
            pass

    def try_external_icon(self):
        """尝试从外部文件设置图标"""
        # 尝试不同的图标文件名
        icon_files = ['logo.ico', 'logo.png', 'logo.jpg', 'icon.ico']

        for icon_file in icon_files:
            if os.path.exists(icon_file):
                try:
                    self.root.iconbitmap(icon_file)
                    print(f"成功从外部文件设置图标: {icon_file}")
                    return True
                except:
                    continue

        print("未找到有效的图标文件")
        return False

    def cleanup_temp_files(self):
        """清理临时文件（可在程序退出时调用）"""
        if hasattr(self, 'temp_icon_path') and os.path.exists(self.temp_icon_path):
            try:
                os.unlink(self.temp_icon_path)
                print(f"已清理临时图标文件: {self.temp_icon_path}")
            except:
                pass

